import logo from './logo.svg';
import './App.css';
import './components/profilepic.js'
import getProfilePic from './components/profilepic.js';

async function App() {
  const profileIMG = getProfilePic();
  return (
    <div className="App">
      <header className="App-header">
        {profileIMG}
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi there
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>  
      </header>
    </div>
  );
}

export default App;
